sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  if(inputs.status_code=='200') 
  {
    var parseResObj=JSON.parse(inputs.response_body);
    outputs.hostname = parseResObj.hostname;
    outputs.city=parseResObj.city;
    outputs.region=parseResObj.region;
    outputs.ipaddress=parseResObj.ipaddress;
    outputs.country=parseResObj.country;
    var locArr=parseResObj.loc.split(",");
    outputs.lattitude=locArr[0];
    outputs.longitude=locArr[1];
  }
})(inputs, outputs);

